import React, { Component } from "react";
import { connect } from "react-redux";
import "./GetCollection.css";
import axios from "axios";
import { TestFunction } from "./actions/allActions";

class GetCollection extends Component {
  componentDidMount() {
    this.props.TestFunction();
  }
  constructor(props) {
    super(props);
    this.state = {
      selectedFile: null,
    };
  }
  onChangeHandler = (event) => {
    this.setState({
      selectedFile: event.target.files[0],
      loaded: 0,
    });
  };
  onClickHandler = () => {
    const data = new FormData();
    data.append("file", this.state.selectedFile);
    axios
      .post("http://localhost:8000/upload", data, {
        // receive two    parameter endpoint url ,form data
      })
      .then((res) => {
        // then print response status
        console.log(res.statusText);
      });
  };
  render() {
    const { testData } = this.props;
    return (
      <div>
        <div class="jumbotron jumbotron-fluid bg-dark text-white">
          <div class="container">
            <h1 class="display-3">Just In Time Development</h1>
            <hr class="display-5" />
            <h4 class="text-right">Get APIs From PostMan Collection</h4>
          </div>
        </div>
        <div class="container">
          <div class="row">
            <div class="col-md-3"></div>
            <div class="col-md-6">
              <form method="post" action="#" id="#">
                <div class="form-group files">
                  <label>Upload Your File </label>
                  <input
                    type="file"
                    class="form-control"
                    onChange={this.onChangeHandler}
                    multiple=""
                  />
                </div>
              </form>
            </div>
            <button
              type="button"
              class="btn btn-success btn-block"
              onClick={this.onClickHandler}
            >
              Upload
            </button>
          </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  testData: state.dataFromReducer.TestDataInAllReducers,
});

export default connect(mapStateToProps, { TestFunction })(GetCollection);
